-- ----------------------------
--  Table structure for `kw_account`
-- ----------------------------
DROP TABLE IF EXISTS `kw_account`;
CREATE TABLE `kw_account` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) DEFAULT NULL,
  `real_name` varchar(30) DEFAULT NULL COMMENT '名字',
  `id_card` varchar(30) DEFAULT NULL COMMENT '身份证',
  `real_status` int(1) DEFAULT '0' COMMENT '认证状态 0 未提交 1 提交待审核。2审核通过。-1 审核失败',
  `usdt_token` varchar(32) DEFAULT NULL,
  `alipay_number` varchar(32) DEFAULT NULL COMMENT '支付宝账号',
  `bank` varchar(32) DEFAULT NULL COMMENT '银行',
  `branch` varchar(32) DEFAULT NULL COMMENT '分行',
  `bank_cardno` varchar(32) DEFAULT NULL COMMENT '卡号',
  `vip_id` int(20) DEFAULT NULL COMMENT 'vip_id',
  `proxy_id` int(20) DEFAULT NULL COMMENT '代理id',
  `nickname` varchar(13) DEFAULT NULL COMMENT '昵称',
  `team_id` bigint(20) DEFAULT NULL COMMENT '战队id',
  `level_id` bigint(20) DEFAULT NULL COMMENT '用户级别',
  `alipay_status` int(1) DEFAULT '0',
  `usdt_status` int(1) DEFAULT '0',
  `bank_status` int(1) DEFAULT '0',
  `sd_status` int(1) DEFAULT '0' COMMENT '世代状态(0待选择城市1待确认 2待打款上传 3.成功',
  `sd_province_city` varchar(24) DEFAULT NULL COMMENT '世代省-市',
  `sd_photo` varchar(255) DEFAULT NULL COMMENT '申请世代时候使用的图片',
  `is_good_sd` int(1) DEFAULT '0' COMMENT '优秀世代标记',
  `createword_status` int(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `sd_status` (`sd_status`),
  KEY `alipay_status` (`alipay_status`),
  KEY `usdt_token` (`usdt_token`),
  KEY `real_status` (`real_status`),
  KEY `bank_status` (`bank_status`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='账户表';

