BEGIN;
INSERT INTO `kw_notice` VALUES ('1', '环保学院', '<video class=\"vedio\" src=\"http://clips.vorwaerts-gmbh.de/big_buck_bunny.mp4\" controls=\"\"></video><p><br/></p><p>擦客服阿水淀粉卡上的水淀粉卡上岛咖啡阿斯顿发送到</p>', '2020-04-13 14:37:25', '1', '2020-04-13 14:35:58', '3'), ('2', '系统维护', '<p>尊敬的OPC家人，为了迎接全新的系统体验感，OPC基金会将于2020年7月1日进行全面的升级。OPC与大家一起成长。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p><br/></p><p><br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2020年4月27日</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;OPC基金会</p>', '2020-04-13 14:37:03', '1', '2020-04-27 19:49:10', '0'), ('3', '教程指南', '<p style=\"text-align: left;\"><span style=\"text-decoration: none;\">1. 海洋宝宝()：注册并经过身份认证，即可享受：微型量子转换器200+/月，</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">&nbsp;</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">2.海洋之星：①直推分享10人；②团队总量子α&nbsp; 或量子β 达到500；大区240，③小区量子α&nbsp; 或量子β 总量260</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">享受赠送：①微型量子转换器；②平台交易手续费30%分红。1万+/月</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">&nbsp;</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">3.海洋骑士：①直推分享20人；②直推两个M1星；③团队量子α 或量子β 达2000。</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">享受赠送：①小型量子转换器；②平台交易手续费20%分红。3—10万+/月</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">&nbsp;</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">4.海洋伯爵：①直推分享30人；②三个M2（限直推）；③团队量子α 或量子β 达8000</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">享受赠送：①中型量子转换器；②小型量子转换器；③平台交易手续费15%分红。10—30万+/月</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">&nbsp;</span></p><p style=\"text-align: left;\"><span style=\"text-decoration: none;\">5.海洋王者:①直推分享40人；②团队3个M3星（限直推）；③团队量子α 或量子β 达20000。享受赠送：①大型量子转换器；②中型量子转换器；③平台交易手续费10%分红。30—100万+/月</span></p><p><br/></p>', '2020-04-13 14:38:07', '1', '2020-04-18 10:51:36', '1'), ('5', '紧急通知', '<p>OPC基金会通知，会员网站升级，升级时间12小时。<br/></p>', '2020-04-27 19:53:29', '1', '2020-04-27 19:53:29', '0'), ('6', '交易规则', '<p>交易时间9：00-21：00，交易前，先联络对方，</p>', '2020-04-30 13:21:44', '1', '2020-04-30 19:31:46', '2');
COMMIT;

