-- ----------------------------
--  Table structure for `kw_team_config`
-- ----------------------------
DROP TABLE IF EXISTS `kw_team_config`;
CREATE TABLE `kw_team_config` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `team` varchar(13) DEFAULT NULL COMMENT '战队名',
  `leader_id` bigint(20) DEFAULT NULL COMMENT '战队领导人id',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建人',
  `team_wechat` varchar(255) DEFAULT NULL COMMENT '微信',
  `slogan` varchar(255) DEFAULT NULL COMMENT '口号',
  `status` tinyint(1) DEFAULT NULL COMMENT '审核状态： -1 失败 0 待审核 1 通过',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='战队配置表';

-- ----------------------------
--  Table structure for `kw_token`
-- ----------------------------
DROP TABLE IF EXISTS `kw_token`;
CREATE TABLE `kw_token` (
  `user_id` bigint(20) NOT NULL,
  `token` varchar(100) NOT NULL COMMENT 'token',
  `expire_time` datetime DEFAULT NULL COMMENT '过期时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `token` (`token`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='会员Token';

-- ----------------------------
--  Table structure for `kw_user`
-- ----------------------------
DROP TABLE IF EXISTS `kw_user`;
CREATE TABLE `kw_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_name` varchar(128) DEFAULT NULL COMMENT '用户名',
  `password` varchar(500) DEFAULT NULL COMMENT '密码',
  `last_login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `last_login_ip` varchar(50) DEFAULT NULL COMMENT '登录IP',
  `mobile` varchar(50) DEFAULT NULL COMMENT '手机号码',
  `create_date` datetime DEFAULT NULL COMMENT '注册时间',
  `create_ip` varchar(50) DEFAULT NULL COMMENT '注册IP',
  `status` tinyint(1) DEFAULT NULL COMMENT '状态：0 启用 1 禁用',
  `pay_password` varchar(500) DEFAULT NULL COMMENT '支付密码',
  `secret_key` varchar(50) DEFAULT NULL COMMENT '谷歌验证码密钥（注册生成）',
  `bind_auth_code` tinyint(1) DEFAULT '0' COMMENT '是否绑定谷歌验证。   0 否。  1是',
  `province` varchar(50) DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13238 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='会员记录';

