DROP TABLE IF EXISTS `kw_user_ltc`;
CREATE TABLE `kw_user_ltc` (
  `name` varchar(50) DEFAULT NULL COMMENT '名称',
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `parent_price` decimal(20,2) DEFAULT NULL COMMENT '母币价格',
  `income_parent_perday` decimal(20,2) DEFAULT NULL COMMENT '母币每日收益',
